    If (!(Test-Path -Path:$Location4)) {
        If (Test-Path -Path:$aroi) {
            Write-Status -Types "+", $TweakType -Status "Installing Adobe Acrobat Reader x64" 
            Start-Process -FilePath:$aroi -ArgumentList /sPB -Verbose
        }
